import { Text, View, StyleSheet, Image, TextInput, TouchableOpacity, Button } from 'react-native';
import { ListItem, Avatar } from "react-native-elements";
import { ScrollView } from "react-native-gesture-handler";

import firebase from "../../config/firebaseconfig"

const AvaliacaoCelular = (props) => {

return (
  <View style={styles.container}>

  <Text style={styles.texto}>
    Lista Celular - CRUD
  </Text>

  <TouchableOpacity style={styles.btnLogout} onPress={navigation.navigate('DetalheCelular')}>
      <Text style={styles.btnText}>DetalheCelular</Text>
  </TouchableOpacity>


  </View>
);
}

export default AvaliacaoCelular;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'black',
